import style from './App.module.css';
import Header from '../Components/Header/Header';

function App() {
  return (
    <div className={style.app_wrapper}>
      <Header />
      <nav className={style.nav}>
        <div>Profile</div>
        <div>Messages</div>
      </nav>
      <div className={style.content}>
        Main Content
      </div>
    </div>
  );
}

export default App;
